  <style>
    * {
      box-sizing: border-box;
      font-size: 14px;
      margin: 0;
      padding: 0;
      font-size: 102.77% !important;
      line-height: 162.37% !important;
    }

    body {
      font-family: Arial, "Helvetica Neue", Helvetica, sans-serif;
      overflow: hidden;
      background-color: #fafafa;
      font-size: 18px;
      color: #000;
      max-width: 600px;
      margin: 0 auto
    }

    img {
      width: 100%
    }

    ul {
      list-style-type: none
    }

    .header {
      width: 100%;
      height: 54px;
      padding: 10px;
      background: #a9003c
    }

    .header__wrapper {
      display: flex;
      align-items: center;
      justify-content: center;
      height: 100%;
      position: relative
    }

    .header__menu {
      width: 32px;
      position: absolute;
      transform: translateY(-50%);
      top: 50%;
      left: 10px;
      z-index: 2
    }

    .header__menu span {
      display: block;
      margin-bottom: 3px;
      height: 6px;
      border-radius: 2px;
      background: #fff
    }

    .header__menu span:last-child {
      margin-bottom: 0
    }

    .header__logo {
      line-height: 1;
      padding: 10px 0;
      color: #fff;
      text-transform: uppercase;
      font-weight: 900;
      font-size: 20px;
      font-style: italic
    }

    .header__logo span {
      color: #a9003c;
      background: #fff;
      padding: 0 2px;
      margin-left: 2px
    }

    .header__text {
      width: 30%
    }

    .header__text:last-child {
      text-align: right
    }

    .main {
      padding: 25px 15px;
      display: flex;
      flex-direction: column;
      min-height: calc(100vh - 70px);
      background: #fff
    }

    .main__filter {
      margin-bottom: 12px
    }

    .main__filter-list {
      display: flex;
      align-items: center
    }

    .main__filter-item {
      padding: 6px 12px;
      text-align: center;
      font-size: 16px;
      border: 1px solid #ccc;
      margin-right: 3px
    }

    .main__filter-item.item--active {
      border: 1px solid #cdbd7c;
      color: #000;
      background-color: #ffeba0
    }

    .main__title {
      text-align: center;
      text-transform: uppercase;
      font-weight: 700;
      margin-bottom: 16px;
      font-size: 1.2rem
    }

    .gallery__item {
      width: 100%;
      margin-bottom: 1rem;
      flex: 1 1 auto;
      display: flex;
      flex-direction: column
    }

    .gallery__item:last-child {
      margin-bottom: 0
    }

    .gallery__item .item__image {
      position: relative;
      overflow: hidden;
      flex: 1 1 auto;
      min-height: 250px;
      color: #fff
    }

    .gallery__item .item__image .image {
      position: absolute;
      top: 50%;
      left: 50%;
      transform: translate(-50%, -50%);
      min-height: 100%;
      min-width: 100%;
      overflow: hidden
    }

    .gallery__item .item__image .image {
      width: 100%;
      filter: blur(30px)
    }

    .gallery__item .item__title {
      padding: 10px;
      text-align: center;
      border: 1px solid #ccc
    }

    .gallery__item .item__rating {
      position: absolute;
      top: 0;
      left: 0;
      padding: 3px 6px 3px 22px;
      background: rgba(0, 0, 0, .7) url(data:image/jpeg;base64,iVBORw0KGgoAAAANSUhEUgAAABAAAAAQCAYAAAAf8/9hAAAA30lEQVQ4jc3SoUpEURDG8d9eFoPIRpOIGAybDYJgmwcwCgaL3RfQahQs6wP4ABbTYLFoF00GMZsXWUQM9wp62LvsusWvzcw3f2bOmY4Jyswj7CIiYjTOU01ornCIHay3+VoBOEAfb3ieCZCZGzhrwouI+JgakJnLuEavSd0U9V/+TlHs4g6bP9JPeMUaVtDFXkRcaYLv5grHRTP1O/SL3NK4FU5xUq7UokFmLpaAWXSL4TyALSzMA7jEqAQ84B6fUwAeIwLFN0JmrmIf2+oT7jXjDvGivpHziHj/4/T/TV8n+zOR5g==) 5% 50% no-repeat;
      color: #fff
    }

    .gallery__item .item__views {
      position: absolute;
      top: 0;
      right: 0;
      padding: 3px 6px 3px 25px;
      background: rgba(0, 0, 0, .7) url(data:image/jpeg;base64,iVBORw0KGgoAAAANSUhEUgAAABAAAAAQCAMAAAAoLQ9TAAAAQlBMVEUAAAC7u7u8vLy8vLysrKy7u7u7u7u7u7u7u7u7u7u7u7u7u7u7u7uwsLCvr6+7u7urq6usrKytra2srKy7u7utra12ojQeAAAAFHRSTlMA8H837z344bm3miwVBgWOhEvShBR2mNwAAABkSURBVBjTjU5JEsAgCAuoXV1qi///ahlHTl7MgSGZEII13NdOtF+38bJJx1Y6jacIcQhMImcEcCh3QIZT5QBYvQxU/4yVdAbUt/nkdKUuuNSaCcP3eTux0Gyh81sFWzGeqi/hB4ybBqVqVZnPAAAAAElFTkSuQmCC) 5% 50% no-repeat;
      color: #fff
    }

    .gallery__item .item__time {
      position: absolute;
      bottom: 5px;
      right: 3px;
      padding: 3px 6px;
      background: rgba(0, 0, 0, .7);
      color: #fff
    }

    .pl {
      display: flex;
      flex-grow: 1;
      margin-top: 10px;
      min-height: 212px;
      position: absolute;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      z-index: 2
    }

    .pl__cnt {
      background-size: contain;
      background-position: center center;
      background-repeat: no-repeat;
      flex-grow: 1
    }

    .pl__cnt {
      align-items: center;
      display: flex;
      justify-content: center;
      position: relative
    }

    .pl__ctr {
      align-items: center;
      bottom: 0;
      display: flex;
      height: 50px;
      position: absolute;
      width: 100%
    }

    .pl__ctr-tm {
      font-size: 11px;
      margin: 0 20px 0 15px
    }

    .pl__ctr-bar {
      background-color: #3f3f3f;
      flex-grow: 1;
      height: 2px;
      margin-right: 15px;
      position: relative
    }

    .pl__ctr-bar:before {
      background-color: #fff;
      border-radius: 50%;
      content: '';
      cursor: pointer;
      height: 16px;
      left: -8px;
      position: absolute;
      top: -8px;
      width: 16px;
      z-index: 1
    }

    .pl__ctr-bar-line {
      -webkit-animation: a 5s both;
      animation: a 5s both;
      background-color: #fff;
      height: 100%;
      left: 0;
      position: absolute;
      transform-origin: left;
      width: 85%
    }

    .pl__ctr-ic {
      cursor: pointer;
      fill: #fff
    }

    .pl__ctr-ic.hd {
      background-color: #000;
      border-radius: 4px;
      fill: #b6d4f0;
      height: 16px;
      width: 33px
    }

    .pl__ctr-ic.mute {
      height: 14px;
      margin: 0 15px
    }

    .pl__ctr-ic.resize {
      height: 18px;
      margin-right: 15px
    }

    .lst__t {
      font-size: large;
      font-weight: 700;
      padding: 0 10px
    }

    .lst__w-i {
      display: flex
    }

    .lst__i {
      background: #292929;
      border-radius: 4px;
      margin: 5px;
      padding: 7px;
      width: 100%;
      overflow: hidden
    }
